package KafkaTesting.demo.Test.Model;import com.fasterxml.jackson.annotation.JsonIgnoreProperties;@JsonIgnoreProperties(ignoreUnknown = true)public class WikimediaEvent {    private String type;    private String title;    private String user;    private long timestamp;    public String getType() { return type; }    public void setType(String type) { this.type = type; }    public String getTitle() { return title; }    public void setTitle(String title) { this.title = title; }    public String getUser() { return user; }    public void setUser(String user) { this.user = user; }    public long getTimestamp() { return timestamp; }    public void setTimestamp(long timestamp) { this.timestamp = timestamp; }    @Override    public String toString() {        return "WikimediaEvent{" +                "type='" + type + '\'' +                ", title='" + title + '\'' +                ", user='" + user + '\'' +                ", timestamp=" + timestamp +                '}';    }}